import React from "react";
import "./Footer.css";

function Footer() {
  return (
    <div>
      <nav className="footernav">
        <div>
        <p className="address">
          Wallawaya Road,
          <br />
          <br />
          Pillewela,
          <br />
          <br />
          Buttala
          <br/>
          071 327 5308
        </p>
        </div>
        
       
      </nav>
    </div>
  );
}

export default Footer;
